#include<bits/stdc++.h>
using namespace std;
void generateBinString(vector<string>& str,string temp,int k){
    if(temp.length() == k){
        str.push_back(temp);
        return;
    }
    
    generateBinString(str,temp+"0",k);
    generateBinString(str,temp+"1",k);
}
bool hasAllCodes(string s, int k) {
    vector<string> binString;
    generateBinString(binString,"",k);
    for(auto x:binString){
        if (s.find(x) == string::npos) return false;  
    }
    
    return true;
}
int main(){
    cout<<hasAllCodes("",19)<<endl;
    return 0;
}